export var BillType;
(function (BillType) {
    BillType["BANK_SLIP"] = "bank_slip";
    BillType["BANK_INVOICE"] = "bank_invoice";
    BillType["SALARY"] = "salary";
    BillType["TRANSFER"] = "transfer";
    BillType["INVESTMENT"] = "investment";
    BillType["TAX"] = "tax";
})(BillType || (BillType = {}));
